import React from 'react'
import { useSelector } from 'react-redux';
import '../../normalize.scss'
import '../../base.scss'
import InitCadastro from '../../components/Cadastro/InicioDoCadastro'
import View from "../view/view"

function Cadastro() {
  const user = useSelector(state => state.user.data);

  function renderCadastro() {
    return ( 
    <View public={true}>
      <InitCadastro/>
    </View>
    )
  }

  function hasCadastro() {
    return ( 
      <div>Você já tem cadastro</div>
    )
  }

  const verificar = () => {
    if (user == true) {
      hasCadastro()
    } else {
      renderCadastro() 
    }
  }

  return (
    <React.Fragment>
      {verificar}
    </React.Fragment>
  )

}

export default Cadastro
